            <h2>部屋の写真を撮る</h2>
            <p className="mt8 fs12">飾りたい場所を引き目で撮影してください</p>
          </div>
          <div className="btn-camera mt24">
            <img src={iconCamera} alt="camera icon" className="icon-camera" />
